import React,{useState} from 'react';
import './App.css';

function App() {
  const [input,setInput]=useState("");
  return (
    <div className="App">
      <h1>Hello</h1>
      <input value={input} onChange={event=>setInput(event.target.value)}></input>
      <button>Send Message</button>
    </div>
  );
}

export default App;
